import React, {Component} from "react"

class Home extends Component{
    render()
    {    
        return(
            <div className="text_content">
                 <p class="display-5 text-white" >“ಇದು ಕೇವಲ ಸಮಯದ ಪ್ರಶ್ನೆಯಾಗಿದೆ Be yourself,<br/> everyone else is already taken.”-Oscar Wilde</p>  
            </div>
            )
    }
}
export default Home
